        private static readonly JsonSerializerSettings JsonSettings = new JsonSerializerSettings
        {
            ContractResolver = new CamelCasePropertyNamesContractResolver(),
            Formatting = Formatting.Indented,
            NullValueHandling = NullValueHandling.Include
        };

        public static string JsonContentType = "application/json";

        private const string Base = "https://candidate.hubteam.com";
        
        private const string UserKey = "?userKey=0000000000000000000000000000";
        private const string Partners = Base + "/candidateTest/v3/problem/dataset" + UserKey;
        private const string Results = Base + "/candidateTest/v3/problem/result" + UserKey;


        public static async Task Main(string[] args)
        {
            var gotime = false;

            // Get suckers

            var json = !gotime 
                ? Suckers 
                : await GetSuckers();

            var partners = JsonConvert.DeserializeObject<PartnerList>(json, JsonSettings).Partners;
            
            // Transform inbound marketing to outbount marketing
            var result = new List<Country>();
            var byCountry = partners.GroupBy(x => x.Country);
            foreach (var partnersInCountry in byCountry)
            {
                var country = new Country(partnersInCountry.Key);
                result.Add(country);

                var sexySuckers = new Dictionary<DateTime, IList<Partner>>();

                foreach (var partner in partnersInCountry)
                {
                    // var daysCanStart = HarlemShake(partner.AvailableDates);
                    var daysCanStart = Yeet(partner.AvailableDates);

                    if (daysCanStart == null)
                        continue;

                    foreach (var dayCanStart in daysCanStart)
                    {
                        sexySuckers.Enlisten(dayCanStart, partner);
                    }
                }

                if (sexySuckers.Count == 0)
                    continue;

                var macksAvailable = sexySuckers.MaxBy(x => x.Value.Count).First();
                country.StartDate = macksAvailable.Key;
                country.SetAttendees(macksAvailable.Value);
            }

            var responses = new CountryList { Countries = result };

            var reelEmInBoys = JsonConvert.SerializeObject(responses, JsonSettings);

            Console.Out.WriteLine(
                !gotime 
                ? reelEmInBoys 
                : await SendOutInboundMarketing(reelEmInBoys));

            Console.ReadLine();
        }

        static IList<DateTime> HarlemShake(IList<DateTime> availableDates)
        {
            var result = new List<DateTime>();
            var ordered = availableDates.OrderBy(x => x).ToList();

            if (ordered.Count > 2)
            {
                for (var i = 1; i < ordered.Count; i++)
                {
                    if (ordered[i] - ordered[i - 1] != TimeSpan.FromDays(1))
                    {
                        result.Add(ordered[i - 1]);
                    }
                }
            }

            return result;
        }

        static IEnumerable<DateTime> Yeet(IEnumerable<DateTime> availableDates)
        {
            return availableDates
                .OrderBy(x => x)
                .Pairwise((first, second) => second - first == TimeSpan.FromDays(1) ? first : (DateTime?)null)
                .Where(x => x != null)
                .Select(x => x.Value);
        }

        static async Task<string> GetSuckers()
        {
            using (var client = new HttpClient())
            {
                client.DefaultRequestHeaders.Clear();
                client.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue(JsonContentType));
                var uri = new Uri(Partners);
                var response = await client.GetAsync(uri);
                response.EnsureSuccessStatusCode();
                return await response.Content.ReadAsStringAsync();
            }
        }

        static async Task<string> SendOutInboundMarketing(string json)
        {
            var content = new StringContent(json, Encoding.UTF8, JsonContentType);
            using (var client = new HttpClient())
            {
                client.DefaultRequestHeaders.Clear();
                var uri = new Uri(Results);

                var response = await client.PostAsync(uri, content);
                response.EnsureSuccessStatusCode();
                return await response.Content.ReadAsStringAsync();
            }
        }

        public static void Enlisten<TKey, TValue>(this IDictionary<TKey, IList<TValue>> dict, TKey key, TValue value)
        {
            if (!dict.TryGetValue(key, out IList<TValue> list))
            {
                dict[key] = list = new List<TValue>();
            }

            list.Add(value);
        }
    }

    public class PartnerList
    {
        public List<Partner> Partners { get; set; }
    }

    public class Partner
    {
        public string FirstName { get; set; }
        public string LastName { get; set; }
        public string Email { get; set; }
        public string Country { get; set; }
        public DateTime[] AvailableDates { get; set; }
    }

    public class CountryList
    {
        public List<Country> Countries { get; set; }
    }

    public class Country
    {
        public Country(string name)
        {
            Name = name;
        }

        public void SetAttendees(IEnumerable<Partner> partners)
        {
            Attendees = partners.Select(x => x.Email).ToArray();
        }

        public string[] Attendees { get; private set; } = new string[0];
        public string Name { get; set; }

        [JsonConverter(typeof(YaNeedDatesOnly))]
        public DateTime? StartDate { get; set; }

        public int AttendeeCount => Attendees?.Length ?? 0;
    }
